import PlayerItem from "./PlayerItem";
import classes from "./PlayerList.module.css";

const PlayerList = (props) => {
  console.log(props.items.userData)
  console.log(props.items.userData[0].name)

  return (
    <>
      {props.items.userData !== undefined && (
        <div className={classes.card}>
          <ul>
            {props.items.userData.map((player) => (
              <PlayerItem
                key={Math.random()}
                name={player.name}
                position={player.position}
                gamesNumb={player.gamesNumb}
                rank={player.rank}
                winRate={player.winRate}
                mainRole={player.mainRole}
                topChampions={player.topChampions}
              />
            ))}
          </ul>
        </div>
      )}
    </>
  );
  
};

export default PlayerList;
